import React from 'react';
import './About.css'; // Create this CSS file for custom styling

const About = () => {
  return (
    <div className="About">
      <h2>About Us</h2>
      <p>[Your Company] is a leading provider of innovative solutions...</p>
    </div>
  );
};

export default About;
